import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const PostForm = () => {
    return(
        <div>
            <h1>Title</h1>
            <input type="text">제목을 입력해주세요</input>
        </div>
    )
}

export default PostForm;
